import { useState } from "react";
import "../Styles/Admin.css";

function App() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  async function loginAdmin(event) {
    event.preventDefault();

    const response = await fetch("http://localhost:1337/api/login-admin", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        email,
        password,
      }),
    });
    const data = await response.json();

    console.log(data);

    if (data.admin) {
      alert("Login successful");
      window.location.href = "/inicio";
    } else {
      alert("Please check your user name and password");
    }
  }

  return (

    <div className="text-center" style={ { paddingTop: "0", paddingLeft: "0", paddingRight: "0", paddingBottom: "15%" } } >

        <form onSubmit={loginAdmin}></form>

    </div>

  );
}

export default App;
